import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <h1>Greetings, this is my first React Application!</h1>
      <h2>May thy walk this new path gracefully, learn a lot, make mistakes, and expouse happiness.</h2>
    </div>
  );
};

export default App;
